import styled from 'styled-components';

export const UsersContiner = styled.div `
    display: flex;
    width: 90vw;
    max-height: 90vh;
    flex-direction: column;
    flex-wrap: wrap;
    & li {
        flex: 1 1 300px;
    }
`
